import React from 'react';
import './entry.css';
import {Clipboard} from 'react-feather';


function CopyToClipboard(){
    var copyText = "https://hubs.mozilla.com/wC84cL3?embed_token=35023d4d924c87911d5353ad934fe30f"
    copyText.select();
    document.execCommand("copy");
}

function tableContent({date,time,host,status, link, statusType}) {
    return (
        <tr className = "text-center">
            <td>{date}</td>
            <td>{time}</td>
            <td>{host}</td>
            <td><a data-aos = "fade-down" className = "mail-3 mx-auto" href = "mailto:email@example.com"><Clipboard size = {24}></Clipboard></a></td>
            <td className = {statusType}>{status}</td>
        </tr>
    )
}

export default tableContent
